set autocommit=0;
INSERT INTO `field_data_body` VALUES ('node','page',0,1,1,'en',0,'We are excited for the opportunity to reconnect and celebrate with everyone this important milestone in our lives. Please join us @ Brooklyn Botanical Garden’s Palm House on June 1, 2014!\r\n\r\n<h2>Sunday, June 1, 2014</h2>\r\nPlease save the date, details coming soon.','','full_html'),('node','page',0,2,2,'und',0,'<div class=\"columns\">\r\nWe first met in the tumult of the financial crisis in a Career Fair in late 2008, where the prospects were bleak for applicants and employers alike :-) And amongst the chaos there she was, a ray of sunshine. \r\n\r\nOur paths crossed again 2 years later in NYC as we commiserated on the unforgiving city tugging us every which way. Over the years when the pressure got tough and I couldn’t take it anymore, there he was -- my ray of light. \r\n\r\nAnd ever since then, we’ve been just like doujiang and youtiao (the Chinese equivalent of peanut butter and jelly). Laughing, crying, exploring, and taking on the world together.\r\n</div>','','full_html'),('node','page',0,3,3,'und',0,'There are three major airports servicing NYC.\r\n\r\nLaGuardia is the closest to Manhattan, and the best way to get into the city upon arrival is to take the short 20 mins cab ride for ~$30. <a href=\"http://www.taxifarefinder.com/main.php?city=NY&from=LaGuardia+Airport%2C+Queens%2C+NY%2C+United+States&to=Union+Square%2C+New+York%2C+NY%2C+United+States\">Taxi Fare Estimate</a>\r\n\r\nJFK is further away, but there is an Airtrain that connects to the Subway that will take you directly into the city in 1h30min for <$10. Alternatively, there is a fixed rate taxi fare to mostly anywhere in Manhattan for $52.\r\n\r\nNewark Liberty International is furthest away and it’s actually in NJ, but I have been able to find some convenient flights from there. There is an <a href=\"http://gonyc.about.com/cs/airlinesairports/a/getto_ewr.htm\">Airtrain/NJ Transit</a> that will take you into Manhattan for ~$10. The cab fare to manhattan is about $70.','','full_html'),('node','page',0,4,4,'und',0,'I would recommend to stay centrally near Union Square/West Village neighborhoods of Manhattan, i.e. anywhere in a 5 block radius between 2nd ave and 8th ave along 14th street. Most subway lines stop on 14th street, and there is a good deal of NYC to explore there. Best of all, most of those subways can take you directly to the wedding venue.\r\n','','full_html'),('node','webform',0,5,5,'und',0,'We hope you\'re able to come to the wedding! It\'s going to be a ton of fun and we\'d love to share the celebrations with you. ','','full_html'),('node','page',0,8,8,'und',0,'<table style=\"width:194px;\"><tr><td align=\"center\" style=\"height:194px;background:url(https://picasaweb.google.com/s/c/transparent_album_background.gif) no-repeat left\"><a href=\"https://picasaweb.google.com/111636226080587430000/BavarianAlps?authuser=0&authkey=Gv1sRgCPn1rKPisLS5YQ&feat=embedwebsite\"><img src=\"https://lh4.googleusercontent.com/-xEXWeYKGQpk/UFC3-_HlDbE/AAAAAAAANus/-G3qJwzbJ7A/s160-c/BavarianAlps.jpg\" width=\"160\" height=\"160\" style=\"margin:1px 0 0 4px;\"></a></td></tr><tr><td style=\"text-align:center;font-family:arial,sans-serif;font-size:11px\"><a href=\"https://picasaweb.google.com/111636226080587430000/BavarianAlps?authuser=0&authkey=Gv1sRgCPn1rKPisLS5YQ&feat=embedwebsite\" style=\"color:#4D4D4D;font-weight:bold;text-decoration:none;\">Bavarian Alps</a></td></tr></table>','','full_html');
/*!40000 ALTER TABLE `field_data_body` ENABLE KEYS */;
UNLOCK TABLES;
commit;

