INSERT INTO `field_data_field_body` VALUES ('bean','homepage_block',0,1,1,'und',0,'Come Celebrate with Us! The ceremony and reception will take place on August 10, 2013 at Schloss Pertenstein, Schlossstraße 4 83301, Traunreut. \r\n\r\n<h3>Saturday, August 10, 2013</h3>\r\nCeremony: 2:00pm\r\nCocktails & Games: 3:00pm\r\nReception: 7:00pm\r\n\r\n<h3>Sunday, August 11, 2013</h3>\r\nBrunch: 11am Location TBD\r\n','full_html'),('bean','homepage_block',0,2,2,'und',0,'We can recommend the following hotels. You should book a room as soon as possible, since August is high vacation season in Germany.\r\n\r\n<h3>Close to the Wedding Venue:</h3>\r\n<ul>\r\n<li><a href=\"http://pension-poschmuehle.de\">Pension Poschmühle</a> (tell them you\'re with Suzanne and Alex\'s wedding, since they\'ve reserved several rooms for our group).\r\n<li><a href=\"http://www.hotelaustermayer.com/\">Hotel Austermayer</a></li>\r\n<li><a href=\"http://www.gasthaus-springer.de/\">Gasthaus Springer</a></li>\r\n</ul>\r\n<h3>On the Lake</h3>\r\n<ul>\r\n<li><a href=\"http://www.chiemseestern.de\">Chiemsee Stern</a></li>\r\n<li><a href=\"http://www.karlshof-niedermaier.de/\">Karlshof Niedermaier</a></li>\r\n<li><a href=\"http://www.gaestehaus-banik.de/\">Gaestehaus Banik</a></li>\r\n</ul>','full_html'),('bean','homepage_block',0,3,3,'und',0,'<h3>Trains</h3>\r\nThere is a train that goes from Munich to Traunreut. Here are the instructions: http://goo.gl/maps/2Zyzx.\r\n\r\n<h3>Planes</h3>\r\nThe closest airports to Schloss Pertenstein are in Munich and Saltzburg. There are direct flights to Munich from Montreal, Toronto, New York, and Odessa. From Canada, you can also take Airtransat to Frankfurt and transfer to a local airline to fly to Munich.\r\n\r\n<h3>Automobiles</h3>\r\nYou can rent a car at the Munich or Saltzburg airport. Here\'s a link to a car rental place that we\'ve used in the past: http://www.sixt.com/car-rental/germany/munich/munich-airport. Be sure to specify automatic if you don\'t know how to drive standard. ','full_html');
/*!40000 ALTER TABLE `field_data_field_body` ENABLE KEYS */;
UNLOCK TABLES;
commit;

