sor settings','','none'),(3592,'','default','Number of items shown in listing pages','','none'),(3593,'','default','Requires a correctly configured <a href=\"@cron\">cron maintenance task</a>.','','none'),(3594,'','default','Select categories using','','none'),(3595,'','default','For a small number of categories, checkboxes are easier to use, while a multiple selector works well with large numbers of categories.','','none'),(3596,'','default','Length of trimmed description','','none'),(3597,'','default','The maximum number of characters used in the trimmed version of content.','','none'),(3598,'','default','The Aggregator module is an on-site syndicator and news reader that gathers and displays fresh content from RSS-, RDF-, and Atom-based feeds made available across the web. Thousands of sites (particularly news sites and blogs) publish their latest headlines in feeds, using a number of standardized XML-based formats. For more information, see the online handbook entry for <a href=\"@aggregator-module\">Aggregator module</a>.','','none'),(3599,'','default','Viewing feeds','','none'),(3600,'','default','Feeds contain published content, and may be grouped in categories, generally by topic. Users view feed content in the <a href=\"@aggregator\">main aggregator display</a>, or by <a href=\"@aggregator-sources\">their source</a> (usually via an RSS feed reader). The most recent content in a feed or category can be displayed as a block through the <a href=\"@admin-block\">Blocks administration page</a>.','','none'),(3601,'','default','Adding, editing, and deleting feeds','','none'),(3602,'','default','Administrators can add, edit, and delete feeds, and choose how often to check each feed for newly updated items on the <a href=\"@feededit\">Feed aggregator administration page</a>.','','none'),(3603,'','default','OPML integration','','none'),(3604,'','default','A <a href=\"@aggregator-opml\">machine-readable OPML file</a> of all feeds is available. OPML is an XML-based file format used to share outline-structured information such as a list of RSS feeds. Feeds can also be <a href=\"@import-opml\">imported via an OPML file</a>.','','none'),(3605,'','default','Configuring cron','','none'),(3606,'','default','A correctly configured <a href=\"@cron\">cron maintenance task</a> is required to update feeds automatically.','','none'),(3607,'','default','<acronym title=\"Outline Processor Markup Language\">OPML</acronym> is an XML format used to exchange multiple feeds between aggregators. A single OPML document may contain a collection of many feeds. Drupal can parse such a file and import all feeds at once, saving you the effort of adding them manually. You may either upload a local file from your computer or enter a URL where Drupal can download it.','','none'),(3608,'','default','Administer news feeds','','none'),(3609,'','default','View news feeds','','none'),(3610,'','default','Configure the behavior of the feed aggregator, including when to discard feed items and how to present feed items and categories.','','none'),(3611,'','default','Override the default title for the block. Use <em>!placeholder</em> to display no title, or leave blank to use the default block title.','','none'),(3612,'','default','Specify in which themes and regions this block is displayed.','','none'),(3613,'','default','All pages except those listed','','none'),(3614,'','default','Only the listed pages','','none'),(3615,'','default','Specify pages by using their paths. Enter one path per line. The \'*\' character is a wildcard. Example paths are %blog for the blog page and %blog-wildcard for every personal blog. %front is the front page.','','none'),(3616,'','default','Pages on which this PHP code returns <code>TRUE</code> (experts only)','','none'),(3617,'','default','Pages or PHP code','','none'),(3618,'','default','If the PHP option is chosen, enter PHP code between %php. Note that executing incorrect PHP code can break your Drupal site.','','none'),(3619,'','default','Customizable per user','','none'),(3620,'','default','Customizable, visible by default','','none'),(3621,'','default','Customizable, hidden by default','','none'),(3622,'','default','Ensure that each block description is unique.','','none'),(3623,'','default','The Block module allows you to create boxes of content, which are rendered into an area, or region, of one or more pages of a website. The core Seven administration theme, for example, implements the regions \"Content\", \"Help\", \"Dashboard main\", and \"Dashboard sidebar\", and a block may appear in any one of these regions. The <a href=\"@blocks\">Blocks administration page</a> provides a drag-and-drop interface for assigning a block to a region, and for controlling the order of blocks within regions. For more information, see the online handbook entry for <a href=\"@block\">Block module</a>.','','none'),(3624,'','default','Positioning content','','none'),(3625,'','default','When working with blocks, remember that all themes do <em>not</em> implement the same regions, or display regions in the same way. Blocks are positioned on a per-theme basis. Users with the <em>Administer blocks</em> permission can disable blocks. Disabled blocks are listed on the <a href=\"@blocks\">Blocks administration page</a>, but are not displayed in any region.','','none'),(3626,'','default','Controlling visibility','','none'),(3627,'','default','Blocks can be configured to be visible only on certain pages, only to users of certain roles, or only on pages displaying certain <a href=\"@content-type\">content types</a>. Administrators can also allow specific blocks to be enabled or disabled by users when they edit their <a href=\"@user\">My account</a> page. Some dynamic blocks, such as those generated by modules, will be displayed only on certain pages.','','none'),(3628,'','default','Creating custom blocks','','none'),(3629,'','default','Users with the <em>Administer blocks</em> permission can <a href=\"@block-add\">add custom blocks</a>, which are then listed on the <a href=\"@blocks\">Blocks administration page</a>. Once created, custom blocks behave just like default and module-generated blocks.','','none'),(3630,'','default','This page provides a drag-and-drop interface for assigning a block to a region, and for controlling the order of blocks within regions. Since not all themes implement the same regions, or display regions in the same way, blocks are positioned on a per-theme basis. Remember that your changes will not be saved until you click the <em>Save blocks</em> button at the bottom of the page. Click the <em>configure</em> link next to each block to configure its specific title and visibility settings.','','none'),(3631,'','default','Demonstrate block regions (@theme)','','none'),(3632,'','default','Administer blocks','','none'),(3633,'','default','A brief description of your block. Used on the <a href=\"@overview\">Blocks administration page</a>.','','none'),(3634,'','default','Personalize blocks','','none'),(3635,'','default','Blocks consist of content or information that complements the main content of the page. Enable or disable optional blocks using the checkboxes below.','','none'),(3636,'','default','Cache blocks','','none'),(3637,'','default','Block caching is inactive because you have enabled modules defining content access restrictions.','','none'),(3638,'','default','Controls the visual building blocks a page is constructed with. Blocks are boxes of content rendered into an area, or region, of a web page.','','none'),(3639,'','default','Use for multi-user blogs. Every user gets a personal blog.','','none'),(3640,'','default','Single-user blogs','','none'),(3641,'','default','Each user\'s blog entries are automatically displayed with a link to the user\'s main blog page. You can create as many single-user blogs as you have site users with permission to create blog content.','','none'),(3642,'','default','Multi-user blogs','','none'),(3643,'','default','Blog entries from each single-user blog are also aggregated into one central multi-user blog, which displays the blog content of all users in a single listing.','','none'),(3644,'','default','There is an optional <em>Blogs</em> menu item added to the Navigation menu, which displays all blogs available on your site, and a <em>My blog</em> item displaying the current user\'s blog entries.','','none'),(3645,'','default','The Blog module also creates a default <em>Recent blog posts</em> block that may be enabled at the <a href=\"@blocks\">blocks administration page</a>.','','none'),(3646,'','default','Create new blog entry','','none'),(3647,'','default','Enables multi-user blogs.','','none'),(3648,'','default','No books available.','','none'),(3649,'','default','Content types allowed in book outlines','','none'),(3650,'','default','Users with the %outline-perm permission can add all content types.','','none'),(3651,'','default','Administer book outlines','','none'),(3652,'','default','The Book module is used for creating structured, multi-page content, such as site resource guides, manuals, and wikis. It allows you to create content that has chapters, sections, subsections, or any similarly-tiered structure. For more information, see the online handbook entry for <a href=\"@book\">Book module</a>.','','none'),(3653,'','default','Adding and managing book content','','none'),(3654,'','default','You can assign separate permissions for <em>creating</em>, <em>editing</em>, and <em>deleting</em> book content, as well as <em>adding content to books</em>, and <em>creating new books</em>. Users with the <em>Administer book outlines</em> permission can add <em>any</em> type of content to a book by selecting the appropriate book outline while editing the content. They can also view a list of all books, and edit and rearrange section titles on the <a href=\"@admin-book\">Book administration page</a>.','','none'),(3655,'','default','Book pages have a default book-specific navigation block. This navigation block contains links that lead to the previous and next pages in the book, and to the level above the current page in the book\'s structure. This block can be enabled on the <a href=\'@admin-block\'>Blocks administration page</a>. For book pages to show up in the book navigation, they must be added to a book outline.','','none'),(3656,'','default','Books can be created collaboratively, as they allow users with appropriate permissions to add pages into existing books, and add those pages to a custom table of contents menu.','','none'),(3657,'','default','Printing books','','none'),(3658,'','default','Users with the <em>View printer-friendly books</em> permission can select the <em>printer-friendly version</em> link visible at the bottom of a book page\'s content to generate a printer-friendly display of the page and all of its subsections.','','none'),(3659,'','default','The book module offers a means to organize a collection of related content pages, collectively known as a book. When viewed, this content automatically displays links to adjacent book pages, providing a simple navigation system for creating and reviewing structured content.','','none'),(3660,'','default','The outline feature allows you to include pages in the <a href=\"@book\">Book hierarchy</a>, as well as move them within the hierarchy or to <a href=\"@book-admin\">reorder an entire book</a>.','','none'),(3661,'','default','Create new books','','none'),(3662,'','default','Add content and child pages to books','','none'),(3663,'','default','View printer-friendly books','','none'),(3664,'','default','View a book page and all of its sub-pages as a single document for ease of printing. Can be performance heavy.','','none'),(3665,'','default','<em>Books</em> have a built-in hierarchical navigation. Use for handbooks or tutorials.','','none'),(3666,'','default','Allows users to create and organize related content in an outline.','','none'),(3667,'','default','The Color module allows users with the <em>Administer site configuration</em> permission to quickly and easily change the color scheme of themes that have been built to be compatible with it. For more information, see the online handbook entry for <a href=\"@color\">Color module</a>.','','none'),(3668,'','default','Changing colors','','none'),(3669,'','default','Using the Color module allows you to easily change the color of links, backgrounds, text, and other theme elements. To change the color settings for a compatible theme, select the <em>Settings</em> link for your theme on the <a href=\'@configure\'>Themes administration page</a>. If you don\'t see a color picker on that page, then your theme is not compatible with the color module. If you are sure that the theme does indeed support the color module, but the color picker does not appear, then <a href=\'@troubleshoot\'>follow these troubleshooting procedures</a>.','','none'),(3670,'','default','The Color module saves a modified copy of the theme\'s specified stylesheets in the files directory. This means that if you make any manual changes to your theme\'s stylesheet, <em>you must save your color settings again, even if they haven\'t changed</em>. This step is required because the module stylesheets (in the files directory) need to be recreated to include your changes.','','none'),(3671,'','default','The GD library for PHP is enabled, but was compiled without PNG support. Check the <a href=\"@url\">PHP image documentation</a> for information on how to correct this.','','none'),(3672,'','default','The GD library for PHP is missing or outdated. Check the <a href=\"@url\">PHP image documentation</a> for information on how to correct this.','','none'),(3673,'','default','Allows administrators to change the color scheme of compatible themes.','','none'),(3674,'','default','Select one or more comments to perform the update on.','','none'),(3675,'','default','There do not appear to be any comments to delete, or your selected comment was deleted by another administrator.','','none'),(3676,'','default','Deleted @count comments.','','none'),(3677,'','default','Deleted comment @cid and its replies.','','none'),(3678,'','default','Comment approved.','','none'),(3679,'','default','Tokens for comments posted on the site.','','none'),(3680,'','default','The Comment module allows users to comment on site content, set commenting defaults and permissions, and moderate comments. For more information, see the online handbook entry for <a href=\"@comment\">Comment module</a>.','','none'),(3681,'','default','Default and custom settings','','none'),(3682,'','default','Each <a href=\'@content-type\'>content type</a> can have its own default comment settings configured as: <em>Open</em> to allow new comments, <em>Hidden</em> to hide existing comments and prevent new comments, or <em>Closed</em> to view existing comments, but prevent new comments. These defaults will apply to all new content created (changes to the settings on existing content must be done manually). Other comment settings can also be customized per content type, and can be overridden for any given item of content. When a comment has no replies, it remains editable by its author, as long as the author has a user account and is logged in.','','none'),(3683,'','default','Full comment','','none'),(3684,'','default','Unapproved comments (@count)','','none'),(3685,'','default','Administer comments and comment settings','','none'),(3686,'','default','Edit own comments','','none'),(3687,'','default','Number of recent comments','','none'),(3688,'','default','Threading','','none'),(3689,'','default','Show comment replies in a threaded list.','','none'),(3690,'','default','Default comment setting for new content','','none'),(3691,'','default','Allow comment title','','none'),(3692,'','default','Show reply form on the same page as comments','','none'),(3693,'','default','Users with the \"Post comments\" permission can post comments.','','none'),(3694,'','default','Users cannot post comments, but existing comments will be displayed.','','none'),(3695,'','default','Comments are hidden from view.','','none'),(3696,'','default','Users cannot post comments.','','none'),(3697,'','default','Your comment has been queued for review by site administrators and will be published after approval.','','none'),(3698,'','default','Your comment has been posted.','','none'),(3699,'','default','<a href=\"@login\">Log in</a> or <a href=\"@register\">register</a> to post comments','','none'),(3700,'','default','<a href=\"@login\">Log in</a> to post comments','','none'),(3701,'','default','Flat list','','none'),(3702,'','default','Threaded list','','none'),(3703,'','default','Save comment','','none'),(3704,'','default','The comment will be unpublished if it contains any of the phrases above. Use a case-sensitive, comma-separated list of phrases. Example: funny, bungee jumping, \"Company, Inc.\"','','none'),(3705,'','default','Published comment %subject.','','none'),(3706,'','default','Saved comment %title','','none'),(3707,'','default','List and edit site comments and the comment approval queue.','','none'),(3708,'','default','Unapproved comments','','none'),(3709,'','default','Example: \'webmaster@example.com\' or \'sales@example.com,support@example.com\' . To specify multiple recipients, separate each e-mail address with a comma.','','none'),(3710,'','default','Category %category has been saved.','','none'),(3711,'','default','You cannot send more than %limit messages in @interval. Try again later.','','none'),(3712,'','default','Contact @username','','none'),(3713,'','default','%sender-name (@sender-from) sent an e-mail regarding %category.','','none'),(3714,'','default','%sender-name (@sender-from) sent %recipient-name an e-mail.','','none'),(3715,'','default','The Contact module allows visitors to contact site administrators and other users. Users specify a subject, write their message, and can have a copy of their message sent to their own e-mail address. For more information, see the online handbook entry for <a href=\"@contact\">Contact module</a>.','','none'),(3716,'','default','User contact forms','','none'),(3717,'','default','Site users can be contacted with a user contact form that keeps their e-mail address private. Users may enable or disable their personal contact forms by editing their <em>My account</em> page. If enabled, a <em>Contact</em> tab leads to a personal contact form displayed on their user profile. Site administrators are still able to use the contact form, even if has been disabled. The <em>Contact</em> tab is not shown when you view your own profile.','','none'),(3718,'','default','Site-wide contact forms','','none'),(3719,'','default','The <a href=\"@contact\">Contact page</a> provides a simple form for users with the <em>Use the site-wide contact form</em> permission to send comments, feedback, or other requests. You can create categories for directing the contact form messages to a set of defined recipients. Common categories for a business site, for example, might include \"Website feedback\" (messages are forwarded to website administrators) and \"Product information\" (messages are forwarded to members of the sales department). E-mail addresses defined within a category are not displayed publicly.','','none'),(3720,'','default','When the site-wide contact form is enabled, a link in the main <em>Navigation</em> menu is created, but the link is disabled by default. This menu link can be enabled on the <a href=\'@menu\'>Menus administration page</a>.','','none'),(3721,'','default','Customization','','none'),(3722,'','default','If you would like additional text to appear on the site-wide or personal contact page, use a block. You can create and edit blocks on the <a href=\"@blocks\">Blocks administration page</a>.','','none'),(3723,'','default','Add one or more categories on this page to set up your site-wide <a href=\"@form\">contact form</a>.','','none'),(3724,'','default','A <em>Contact</em> menu item (disabled by default) is added to the Navigation menu, which you can modify on the <a href=\"@menu-settings\">Menus administration page</a>.','','none'),(3725,'','default','If you would like additional text to appear on the site-wide contact page, use a block. You can create and edit blocks on the <a href=\"@blocks\">Blocks administration page</a>.','','none'),(3726,'','default','Administer contact forms and contact form settings','','none'),(3727,'','default','Use the site-wide contact form','','none'),(3728,'','default','Use users\' personal contact forms','','none'),(3729,'','default','!sender-name (!sender-url) sent a message using the contact form at !form-url.','','none'),(3730,'','default','[!site-name] !subject','','none'),(3731,'','default','!sender-name (!sender-url) has sent you a message via your contact form (!form-url) at !site-name.','','none'),(3732,'','default','If you don\'t want to receive such e-mails, you can change your settings at !recipient-edit-url.','','none'),(3733,'','default','Allow other users to contact you via a <a href=\"@url\">personal contact form</a> which keeps your e-mail address hidden. Note that some privileged users such as site administrators are still able to contact you even if you choose to disable this feature.','','none'),(3734,'','default','Enable the personal contact form by default for new users.','','none'),(3735,'','default','Changing this setting will not affect existing users.','','none'),(3736,'','default','The Contextual links module displays links related to regions of pages on your site to users with <em>access contextual links</em> permission. For more information, see the online handbook entry for <a href=\"@contextual\">Contextual links module</a>.','','none'),(3737,'','default','Displaying contextual links','','none'),(3738,'','default','Contextual links are supplied by modules, to give you quick access to tasks associated with regions of pages on your site. For instance, if you have a custom menu block displayed in a sidebar of your site, the Blocks and Menus modules will supply links to configure the block and edit the menu. The Contextual links module collects these links into a list for display by your theme, and also adds JavaScript code to the page to hide the links initially, and display them when your mouse hovers over the block.','','none'),(3739,'','default','Use contextual links','','none'),(3740,'','default','Use contextual links to perform actions related to elements on a page.','','none'),(3741,'','default','Contextual links','','none'),(3742,'','default','Provides contextual links to perform actions related to elements on a page.','','none'),(3743,'','default','Tracking user activity','','none'),(3744,'','default','By enabling blocks such as <em>Who\'s online</em> and <em>Who\'s new</em>, site users can track who is logged in and new user signups at a centralized location.','','none'),(3745,'','default','Tracking content activity','','none'),(3746,'','default','By enabling blocks such as <em>Recent blog posts</em>, <em>New forum topics</em> and <em>Recent comments</em>, site users can view newly added site content at a glance.','','none'),(3747,'','default','View the administrative dashboard','','none'),(3748,'','default','This dashboard region is empty. Click <em>Customize dashboard</em> to add blocks to it.','','none'),(3749,'','default','DRAG HERE','','none'),(3750,'','default','Provides a dashboard page in the administrative interface for organizing administrative tasks and tracking information within your site.','','none'),(3751,'','default','Customize dashboard','','none'),(3752,'','default','Clear log messages','','none'),(3753,'','default','This will permanently remove the log messages from the database.','','none'),(3754,'','default','Database log cleared.','','none'),(3755,'','default','The Database logging module logs system events in the Drupal database. For more information, see the online handbook entry for the 