stom module developed using the <a href=\"@storage-api\">field storage API</a>.','','none'),(3770,'','default','The Field SQL storage module stores field data in the database. It is the default field storage module; other field storage mechanisms may be available as contributed modules. See the <a href=\"@field-help\">Field module help page</a> for more information about fields.','','none'),(3771,'','default','Default SQL storage','','7.19'),(3772,'','default','Stores fields in the local SQL database, using per-field tables.','','7.19'),(3773,'','default','Field SQL storage','','none'),(3774,'','default','Stores field data in an SQL database.','','none'),(3775,'','default','The List module defines various fields for storing a list of items, for use with the Field module. Usually these items are entered through a select list, checkboxes, or radio buttons. See the <a href=\"@field-help\">Field module help page</a> for more information about fields.','','none'),(3776,'','default','This field stores simple on/off or yes/no options.','','none'),(3777,'','default','List (text)','','none'),(3778,'','default','The \'checkboxes/radio buttons\' widget will display checkboxes if the <em>Number of values</em> option is greater than 1 for this field, otherwise radios will be displayed.','','none'),(3779,'','default','Allowed HTML tags in labels: @tags','','none'),(3780,'','default','The value of this field is being determined by the %function function and may not be changed.','','none'),(3781,'','default','Allowed values list: each key must be a valid integer or decimal.','','none'),(3782,'','default','Allowed values list: each key must be a string at most 255 characters long.','','none'),(3783,'','default','Allowed values list: keys must be integers.','','none'),(3784,'','default','Defines list field types. Use with Options to create selection lists.','','none'),(3785,'','default','The Number module defines various numeric field types for the Field module. Numbers can be in int