ypes: !extensions.','','none'),(3862,'','default','Images must be exactly !size pixels.','','none'),(3863,'','default','Images must be between !min and !max pixels.','','none'),(3864,'','default','Images must be larger than !min pixels.','','none'),(3865,'','default','Images must be smaller than !max pixels.','','none'),(3866,'','default','The File module defines a <em>File</em> field type for the Field module, which lets you manage and validate uploaded files attached to content on your site (see the <a href=\"@field-help\">Field module help page</a> for more information about fields). For more information, see the online handbook entry for <a href=\"@file\">File module</a>.','','none'),(3867,'','default','Attaching files to content','','none'),(3868,'','default','The File module allows users to attach files to content (e.g., PDF files, spreadsheets, etc.), when a <em>File</em> field is added to a given content type using the <a href=\"@fieldui-help\">Field UI module</a>. You can add validation options to your File field, such as specifying a maximum file size and allowed file extensions.','','none'),(3869,'','default','Managing attachment display','','none'),(3870,'','default','When you attach a file to content, you can specify whether it is <em>listed</em> or not. Listed files are displayed automatically in a section at the bottom of your content; non-listed files are available for embedding in your content, but are not included in the list at the bottom.','','none'),(3871,'','default','Managing file locations','','none'),(3872,'','default','When you create a File field, you can specify a directory where the files will be stored, which can be within either the <em>public</em> or <em>private</em> files directory. Files in the public directory can be accessed directly through the web server; when public files are listed, direct links to the files are used, and anyone who knows a file\'s URL can download the file. Files in the private directory are not accessible directly through the web server; when private files are listed, the links are Drupal path requests. This adds to server load and download time, since Drupal must start up and resolve the path for each file download request, but allows for access restrictions.','','none'),(3873,'','default','An unrecoverable error occurred. Use of this form has expired. Try reloading the page and submitting again.','','none'),(3874,'','default','The file referenced by the !name field does not exist.','','none'),(3875,'','default','The file in the !name field was unable to be uploaded.','','none'),(3876,'','default','The upload directory %directory for the file field !name could not be created or is not accessible. A newly uploaded file could not be saved in this directory as a consequence, and the upload was canceled.','','none'),(3877,'','default','Your server is not capable of displaying file upload progress. File upload progress requires an Apache server running PHP with mod_php.','','none'),(3878,'','default','All roles may use this format','','none'),(3879,'','default','The text format ordering has been saved.','','none'),(3880,'','default','Add text format','','7.19'),(3881,'','default','All roles for this text format must be enabled and cannot be changed.','','none'),(3882,'','default','Filter processing order','','none'),(3883,'','default','Text format names must be unique. A format named %name already exists.','','none'),(3884,'','default','Added text format %format.','','none'),(3885,'','default','The text format %format has been updated.','','none'),(3886,'','default','Text formats','','7.19'),(3887,'','default','The Filter module allows administrators to configure text formats. A text format defines the HTML tags, codes, and other input allowed in content and comments, and is a key feature in guarding against potentially damaging input from malicious users. For more information, see the online handbook entry for <a href=\"@filter\">Filter module</a>.','','none'),(3888,'','default','Applying filters to text','','none'),(3889,'','default','Each text format uses filters to manipulate text, and most formats apply several different filters to text in a specific order. Each filter is designed for a specific purpose, and generally either adds, removes, or transforms elements within user-entered text before it is displayed. A filter does not change the actual content, but instead, modifies it temporarily before it is displayed. One filter may remove unapproved HTML tags, while another automatically adds HTML to make URLs display as clickable links.','','none'),(3890,'','default','Defining text formats','','none'),(3891,'','default','One format is included by default: <em>Plain text</em> (which removes all HTML tags). Additional formats may be created by your installation profile when you install Drupal, and more can be created by an administrator on the <a href=\"@text-formats\">Text formats page</a>.','','none'),(3892,'','default','Choosing a text format','','none'),(3893,'','default','A text format contains filters that change the user input, for example stripping out malicious HTML or making URLs clickable. Filters are executed from top to bottom and the order is important, since one filter may prevent another filter from doing its job. For example, when URLs are converted into links before disallowed HTML tags are removed, all links may be removed. When this happens, the order of filters may need to be re-arranged.','','none'),(3894,'','default','Warning: This permission may have security implications depending on how the text format is configured.','','none'),(3895,'','default','Use the !text_format text format','','none'),(3896,'','default','More information about text formats','','7.19'),(3897,'','default','Limit allowed HTML tags','','7.19'),(3898,'','default','Convert line breaks into HTML (i.e. <code>&lt;br&gt;</code> and <code>&lt;p&gt;</code>)','','7.19'),(3899,'','default','Convert URLs into links','','7.19'),(3900,'','default','