ki/Exchangeable_image_file_format\">EXIF data</a> in the image.','','none'),(4006,'','default','Minimum image resolution','','none'),(4007,'','default','The minimum allowed image size expressed as WIDTHxHEIGHT (e.g. 640x480). Leave blank for no restriction. If a smaller image is uploaded, it will be rejected.','','none'),(4008,'','default','Enable <em>Alt</em> field','','none'),(4009,'','default','The alt attribute may be used by search engines, screen readers, and when the image cannot be loaded.','','none'),(4010,'','default','Enable <em>Title</em> field','','none'),(4011,'','default','The title attribute is used as a tooltip when the mouse hovers over the image.','','none'),(4012,'','default','Height and width values must be numeric.','','none'),(4013,'','default','Both a height and width value must be specified in the !name field.','','none'),(4014,'','default','Preview image style','','none'),(4015,'','default','no preview','','none'),(4016,'','default','The preview image will be shown while editing the content.','','none'),(4017,'','default','The Image module allows you to manipulate images on your website. It exposes a setting for using the <em>Image toolkit</em>, allows you to configure <em>Image styles</em> that can be used for resizing or adjusting images on display, and provides an <em>Image</em> field for attaching images to content. For more information, see the online handbook entry for <a href=\"@image\">Image module</a>.','','none'),(4018,'','default','Manipulating images','','none'),(4019,'','default','With the Image module you can scale, crop, resize, rotate and desaturate images without affecting the original image using <a href=\"@image\">image styles</a>. When you change an image style, the module automatically refreshes all created images. Every image style must have a name, which will be used in the URL of the generated images. There are two common approaches to naming image styles (which you use will depend on how the image style is being applied):','','none'),(4020,'','default','Based on where it will be used: eg. <em>profile-picture</em>','','none'),(4021,'','default','Describing its appearance: eg. <em>square-85x85</em>','','none'),(4022,'','default','Attaching images to content as fields','','none'),(4023,'','default','Image module also allows you to attach images to content as fields. To add an image field to a <a href=\'@content-type\'>content type</a>, go to the content type\'s <em>manage fields</em> page, and add a new field of type <em>Image</em>. Attaching images to content this way allows image styles to be applied and maintained, and also allows you more flexibility when theming.','','none'),(4024,'','default','Image styles commonly provide thumbnail sizes by scaling and cropping images, but can also add various effects before an image is displayed. When an image is displayed with a style, a new file is created and the original image is left unchanged.','','none'),(4025,'','default','Administer image styles','','none'),(4026,'','default','Create and modify styles for generating image modifications such as thumbnails.','','none'),(4027,'','default','No defined styles','','none'),(4028,'','default','Image generation in progress. Try again shortly.','','none'),(4029,'','default','Error generating image.','','none'),(4030,'','default','Unable to generate the derived image located at %path.','','none'),(4031,'','default','Failed to create style directory: %directory','','none'),(4032,'','default','Cached image file %destination already exists. There may be an issue with your rewrite configuration.','','none'),(4033,'','default','Generate image style','','none'),(4034,'','default','Image styles','','7.19'),(4035,'','default','Configure styles that can be used for resizing or adjusting images on display.','','7.19'),(4036,'','default','List the current image styles on the site.','','7.19'),(4037,'','default','Add style','','7.19'),(4038,'','default','Add a new image style.','','7.19'),(4039,'','default','Configure an image style.','','none'),(4040,'','default','Delete an image style.','','none'),(4041,'','default','Revert style','','none'),(4042,'','default','Revert an image style.','','none'),(4043,'','default','Edit image effect','','none'),(4044,'','default','Delete image effect','','none'),(4045,'','default','Add image effect','','none'),(4046,'','default','Add a new effect to a style.','','none'),(4047,'','default','Provides image manipulation tools.','','none'),(4048,'','default','Use the <em>Custom language</em> section below if your desired language does not appear in this list.','','none'),(4049,'','default','Path prefix language code','','none'),(4050,'','default','Language code or other custom text to use as a path prefix for URL language detection, if your <em>Detection and selection</em> settings use URL path prefixes. For the default language, this value may be left blank. <strong>Modifying this value may break existing URLs. Use with caution in a production environment.</strong> Example: Specifying \"deutsch\" as the path prefix code for German results in URLs like \"example.com/deutsch/contact\".','','none'),(4051,'','default','Detection method','','none'),(4052,'','default','Part of the URL that determines language','','none'),(4053,'','default','<em>Path prefix</em>: URLs like http://example.com/de/contact set language to German (de). <em>Domain</em>: URLs like http://de.example.com/contact set the language to German. <strong>Warning: Changing this setting may break incoming URLs. Use with caution on a production site.</strong>','','none'),(4054,'','default','Request/session parameter','','none'),(4055,'','default','Name of the request/session parameter used to determine the desired language.','','none'),(4056,'','default','Filter translatable strings','','none'),(4057,'','default','Date type','','none'),(4058,'','default','Are you sure you want to reset the date formats for %language to the global defaults?','','none'),(4059,'','default','Resetting will remove all localized date formats for this language. This action cannot be undone.','','none'),(4060,'','default','The Locale module allows your Drupal site to be presented in languages other than the default English, and to be multilingual. The Locale module works by maintaining a database of translations, and examining text as it is about to be displayed. When a translation of the text is available in the language to be displayed, the translation is displayed rather than the original text. When a translation is unavailable, the original text is displayed, and then stored for review by a translator. For more information, see the online handbook entry for <a href=\"@locale\">Locale module</a>.','','none'),(4061,'','default','Translating interface text','','none'),(4062,'','default','Translations of text in the Drupal interface may be provided by:','','none'),(4063,'','default','Translating within your site, using the Locale module\'s integrated <a href=\'@translate\'>translation interface</a>.','','none'),(4064,'','default','Importing files from a set of existing translations, known as a translation package. A translation package enables the display of a specific version of Drupal in a specific language, and contains files in the Gettext Portable Object (<em>.po</em>) format. Although not all languages are available for every version of Drupal, translation packages for many languages are available for download from the <a href=\"@translations\">Drupal translations page</a>.','','none'),(4065,'','default','If an existing translation package does not meet your needs, the Gettext Portable Object (<em>.po</em>) files within a package may be modified, or new <em>.po</em> files may be created, using a desktop Gettext editor. The Locale module\'s <a href=\'@import\'>import</a> feature allows the translated strings from a new or modified <em>.po</em> file to be added to your site. The Locale module\'s <a href=\'@export\'>export</a> feature generates files from your site\'s translated strings, that can either be shared with others or edited offline by a Gettext translation editor.','','none'),(4066,'','default','Configuring a multilingual site','','none'),(4067,'','default','Language negotiation allows your site to automatically change language based on the domain or path used for each request. Users may (optionally) select their preferred language on their <em>My account</em> page, and your site can be configured to honor a web browser\'s preferred language settings. Site content can be translated using the <a href=\'@content-help\'>Content translation module</a>.','','none'),(4068,'','default','With multiple languages enabled, interface text can be translated, registered users may select their preferred language, and authors can assign a specific language to content. <a href=\"@translations\">Download contributed translations</a> from Drupal.org.','','none'),(4069,'','default','Add a language to be supported by your site. If your desired language is not available in the <em>Language name</em> drop-down, click <em>Custom language</em> and provide a language code and other details manually. When providing a language code manually, be sure to enter a standardized language code, since this code may be used by browsers to determine an appropriate display language.','','none'),(4070,'','default','Determine the language from a request/session parameter. Example: \"http://example.com?language=de\" sets language to German based on the use of \"de\" within the \"language\" parameter.','','none'),(4071,'','default','See the <a href=\"@languages\">Languages page</a> for more information on adding support for additional languages.','','none'),(4072,'','default','This page imports the translated strings contained in an individual Gettext Portable Object (<em>.po</em>) file. Normally distributed as part of a translation package (each translation package may contain several <em>.po</em> files), a <em>.po</em> file may need to be imported after offline editing in a Gettext translation editor. Importing an individual <em>.po</em> file may be a lengthy process.','','none'),(4073,'','default','This page allows a translator to search for specific translated and untranslated strings, and is used when creating or editing translations. (Note: For translation tasks involving many strings, it may be more convenient to <a href=\"@export\">export</a> strings for offline editing in a desktop Gettext translation editor.) Searches may be limited to strings found within a specific text group or in a specific language.','','none'),(4074,'','default','Administer languages','','none'),(4075,'','default','Translate interface texts','','none'),(4076,'','default','Order of language detection methods for content. If a version of content is available in the detected language, it will be displayed.','','none'),(4077,'','default','Order of language detection methods for user interface text. If a translation of user interface text is available in the detected language, it will be displayed.','','none'),(4078,'','default','Determine the language from the URL (Path prefix or domain).','','none'),(4079,'','default','Determine the language from a request/session parameter.','','none'),(4080,'','default','Follow the user\'s language preference.','','none'),(4081,'','default','Determine the language from the browser\'s language settings.','','none'),(4082,'','default','Language switcher (@type)','','none'),(4083,'','default','Detection and selection','','7.19'),(4084,'','default','URL language detection configuration','','7.19'),(4085,'','default','Session language detection configuration','','7.19'),(4086,'','default','Localize','','7.19'),(4087,'','default','Localize date formats','','none'),(4088,'','default','Reset date formats','','none'),(4089,'','default','Reset localized date formats to global defaults','','none'),(4090,'','default','January','Long month name','none'),(4091,'','default','February','Long month name','none