rce for the Main links','','none'),(4118,'','default','Select what should be displayed as the Main links (typically at the top of the page).','','none'),(4119,'','default','No Secondary links','','none'),(4120,'','default','Source for the Secondary links','','none'),(4121,'','default','Select the source for the Secondary links. An advanced option allows you to use the same source for both Main links (currently %main) and Secondary links: if your source menu has two levels of hierarchy, the top level menu links will appear in the Main links, and the children of the active link will appear in the Secondary links.','','none'),(4122,'','default','Deleted custom menu %title and all its menu links.','','none'),(4123,'','default','Deleted menu link %title.','','none'),(4124,'','default','<strong>Warning:</strong> There is currently 1 menu link in %title. It will be deleted (system-defined items will be reset).','','none'),(4125,'','default','<strong>Warning:</strong> There are currently @count menu links in %title. They will be deleted (system-defined links will be reset).','','none'),(4126,'','default','<strong>Warning:</strong> There are currently @count[2] menu links in %title. They will be deleted (system-defined links will be reset).','','none'),(4127,'','default','Managing menus','','none'),(4128,'','default','Users with the <em>Administer menus and menu items</em> permission can add, edit and delete custom menus on the <a href=\"@menu\">Menus administration page</a>. Custom menus can be special site menus, menus of external links, or any combination of internal and external links. You may create an unlimited number of additional menus, each of which will automatically have an associated block. By selecting <em>list links</em>, you can add, edit, or delete links for a given menu. The links listing page provides a drag-and-drop interface for controlling the order of links, and creating a hierarchy within the menu.','','none'),(4129,'','default','Displaying menus','','none'),(4130,'','default','After you have created a menu, you must enable and position the associated block on the <a href=\"@blocks\">Blocks administration page</a>.','','none'),(4131,'','default','You can enable the newly-created block for this menu on the <a href=\"@blocks\">Blocks administration page</a>.','','none'),(4132,'','default','Each menu has a corresponding block that is managed on the <a href=\"@blocks\">Blocks administration page</a>.','','none'),(4133,'','default','Administer menus and menu items','','none'),(4134,'','default','Provide a menu link','','7.19'),(4135,'','default','Menu links with smaller weights are displayed before links with larger weights.','','7.19'),(4136,'','default','Available menus','','none'),(4137,'','default','The menus available to place links in for this content type.','','none'),(4138,'','default','Default parent item','','none'),(4139,'','default','Choose the menu item to be the default parent for a new link in the content authoring form.','','none'),(4140,'','default','Add new menus to your site, edit existing menus, and rename and reorganize menu links.','','7.19'),(4141,'','default','Parent menu items','','none'),(4142,'','default','Edit menu link','','none'),(4143,'','default','Reset menu link','','none'),(4144,'','default','Delete menu link','','none'),(4145,'','default','The <em>Navigation</em> menu contains links intended for site visitors. Links are added to the <em>Navigation</em> menu automatically by some modules.','','none'),(4146,'','default','The <em>User</em> menu contains links related to the user\'s account, as well as the \'Log out\' link.','','none'),(4147,'','default','The <em>Management</em> menu contains links for administrative tasks.','','none'),(4148,'','default','The <em>Main</em> menu is used on many sites to show the major sections of the site, often in a top navigation bar.','','none'),(4149,'','default','manage display','','none'),(4150,'','default','No content types available. <a href=\"@link\">Add content type</a>.','','none'),(4151,'','default','The human-readable name of this content type. This text will be displayed as part of the list on the <em>Add new content</em> page. It is recommended that this name begin with a capital letter and contain only letters, numbers, and spaces. This name must be unique.','','none'),(4152,'','default','Describe this content type. The text will be displayed on the <em>Add new content</em> page.','','none'),(4153,'','default','Preview before submitting','','none'),(4154,'','default','This text will be displayed at the top of the page when creating or editing content of this type.','','none'),(4155,'','default','Users with the <em>Administer content</em> permission will be able to override these options.','','none'),(4156,'','default','Display author and date information.','','none'),(4157,'','default','Author username and publish date will be displayed.','','none'),(4158,'','default','Invalid machine-readable name. Enter a name other than %invalid.','','none'),(4159,'','default','%type is used by 1 piece of content on your site. If you remove this content type, you will not be able to edit the %type content and it may not display correctly.','','none'),(4160,'','default','%type is used by @count pieces of content on your site. If you remove %type, you will not be able to edit the %type content and it may not display correctly.','','none'),(4161,'','default','%type is used by @count[2] pieces of content on your site. If you remove %type, you will not be able to edit the %type content and it may not display correctly.','','none'),(4162,'','default','Publish selected content','','none'),(4163,'','default','Unpublish selected content','','none'),(4164,'','default','Promote selected content to front page','','none'),(4165,'','default','Demote selected content from front page','','none'),(4166,'','default','Make selected content sticky','','none'),(4167,'','default','Make selected content not sticky','','none'),(4168,'','default','Delete selected content','','none'),(4169,'','default','Deleted @count posts.','','none'),(4170,'','default','Are you sure you want to delete this item?','','none'),(4171,'','default','Are you sure you want to delete these items?','','none'),(4172,'','default','<em>Edit @type</em> @title','','7.19'),(4173,'','default','You have not created any content types yet. Go to the <a href=\"@create-content\">content type creation page</a> to add a new content type.','','none'),(4174,'','default','Revision log message','','7.19'),(4175,'','default','Provide an explanation of the changes you are making. This will help other authors understand your motivations.','','7.19'),(4176,'','default','Tokens related to individual content items, or \"nodes\".','','none'),(4177,'','default','The unique ID of the content item, or \"node\".','','none'),(4178,'','default','The main body text of the node.','','none'),(4179,'','default','The summary of the node\'s main body text.','','none'),(4180,'','default','The content access permissions need to be rebuilt. <a href=\"@node_access_rebuild\">Rebuild permissions</a>.','','none'),(4181,'','default','The Node module manages the creation, editing, deletion, settings, and display of the main site content. Content items managed by the Node module are typically displayed as pages on your site, and include a title, some meta-data (author, creation time, content type, etc.), and optional fields containing text or other data (fields are managed by the <a href=\"@field\">Field module</a>). For more information, see the online handbook entry for <a href=\"@node\">Node module</a>.','','none'),(4182,'','default','Creating content','','none'),(4183,'','default','When new content is created, the Node module records basic information about the content, including the author, date of creation, and the <a href=\"@content-type\">Content type</a>. It also manages the <em>publishing options</em>, which define whether or not the content is published, promoted to the front page of the site, and/or sticky at the top of content lists. Default settings can be configured for each <a href=\"@content-type\">type of content</a> on your site.','','none'),(4184,'','default','Creating custom content types','','none'),(4185,'','default','The Node module gives users with the <em>Administer content types</em> permission the ability to <a href=\"@content-new\">create new content types</a> in addition to the default ones already configured. Creating custom content types allows you the flexibility to add <a href=\"@field\">fields</a> and configure default settings that suit the differing needs of various site content.','','none'),(4186,'','default','Administering content','','none'),(4187,'','default','The <a href=\"@content\">Content administration page</a> allows you to review and bulk manage your site content.','','none'),(4188,'','default','Creating revisions','','none'),(4189,'','default','The Node module also enables you to create multiple versions of any content, and revert to older versions using the <em>Revision information</em> settings.','','none'),(4190,'','default','User permissions','','none'),(4191,'','default','The Node module makes a number of permissions available for each content type, which can be set by role on the <a href=\"@permissions\">permissions page</a>.','','none'),(4192,'','default','Individual content types can have different fields, behaviors, and permissions assigned to them.','','none'),(4193,'','default','Content items can be displayed using different view modes: Teaser, Full content, Print, RSS, etc. <em>Teaser</em> is a short format that is typically used in lists of multiple content items. <em>Full content</em> is typically used when the content is displayed on its own page.','','none'),(4194,'','default','Here, you can define which fields are shown and hidden when %type content is displayed in each view mode, and define how the fields are displayed in each view mode.','','none'),(4195,'','default','Revisions allow you to track differences between multiple versions of your content, and revert back to older versions.','','none'),(4196,'','default','Full content','','7.19'),(4197,'','default','Search result','','none'),(4198,'','default','The content on this page has either been modified by another user, or you have already submitted modifications using this form. As a result, your changes cannot be saved.','','none'),(4199,'','default','Administer content types','','none'),(4200,'','default','Warning: Give to trusted roles only; this permission has security implications.','','none'),(4201,'','default','View published content','','none'),(4202,'','default','Access the content overview page','','none'),(4203,'','default','Bypass content access control','','none'),(4204,'','default','View content revisions','','none'),(4205,'','default','Revert content revisions','','none'),(4206,'','default','Delete content revisions','','none'),(4207,'','default','View own unpublished content','','none'),(4208,'','default','Content is sticky at top of lists','','none'),(4209,'','default','Content is promoted to the front page','','none'),(4210,'','default','Recent content','','none'),(4211,'','default','Number of recent content items to display','','none'),(4212,'','default','Show block for specific content types','','none'),(4213,'','default','Show this block only on pages that display content of the given type(s). If you select no types, there will be no type-specific limitation.','','none'),(4214,'','default','Welcome to @site-name','','none'),(4215,'','default','No front page content has been created yet.','','none'),(4216,'','default','Unpublish content','','none'),(4217,'','default','Make content sticky','','none'),(4218,'','default','Make content unsticky','','none'),(4219,'','default','Promote content to front page','','none'),(4220,'','default','Remove content from front page','','none'),(4221,'','default','Change the author of content','','none'),(4222,'','default','Save content','','none'),(4223,'','default','Unpublish content containing keyword(s)','','none'),(4224,'','default','The content will be unpublished if it contains any of the phrases above. Use a case-sensitive, comma-separated list of phrases. Example: funny, bungee jumping, \"Company, Inc.\"','','none'),(4225,'','default','If the site is experiencing problems with permissions to content, you may have to rebuild the permissions cache. Rebuilding will remove all privileges to content and replace them with permissions based on the current modules and settings. Rebuilding may take some time if there is a lot of content or complex permission settings. After rebuilding has completed, content will automatically use the new permissions.','','none'),(4226,'','default','Node Access Permissions','','none'),(4227,'','default','One permission in use','','none'),(4228,'','default','@count permissions in use','','none'),(4229,'','default','@count[2] permissions in use','','none'),(4230,'','default','Find and manage content.','','7.19'),(4231,'','default','Manage content types, including default status, front page promotion, comment settings, etc.','','7.19'),(4232,'','default','Edit content type','','none'),(4233,'','default','This site supports <a href=\"@openid-net\">OpenID</a>, a secure way to log in to many websites using a single username and password. OpenID can reduce the necessity of managing many usernames and passwords for many websites.','','none'),(4234,'','default','If you already have an OpenID, enter the URL to your OpenID server below (e.g. myusername.openidprovider.com). Next time you log in, you will be able to use this URL instead of a regular username and password. You can have multiple OpenID servers if you like; just keep adding them here.','','none'),(4235,'','default','The OpenID module allows users to log in using the OpenID single sign on service. <a href=\"@openid-net\">OpenID</a> is a secure method for logging into many websites with a single username and password. It does not require special software, and it does not share passwords with any site to which it is associated, including the site being logged into. The main benefit to users is that they can have a single password that they can use on many websites. This means they can easily update their single password from a centralized location, rather than having to change dozens of passwords individually. For more information, see the online handbook entry for <a href=\"@handbook\">OpenID module</a>.','','none'),(4236,'','default','Logging in with OpenID','','none'),(4237,'','default','To log in using OpenID, a user must already have an OpenID account. Users can then create site accounts using their OpenID, assign one or more OpenIDs to an existing account, and log in using an OpenID. This lowers the barrier to registration, which helps increase the user base, and offers convenience and security to the users. Because OpenID cannot guarantee a user is legitimate, email verification is still necessary. When logging in, users are presented with the option of entering their OpenID URL, which will look like <em>myusername.openidprovider.com</em>. The site then communicates with the OpenID server, asking it to verify the identity of the user. If the user is logged into their OpenID server, the server communicates back to your site, verifying the user. If they are not logged in, the OpenID server will ask the user for their password. At no point does the site being logged into record the user\'s OpenID password.','','none'),(4238,'','default','Once you have verified your e-mail address, you may log in via OpenID.','','none'),(4239,'','default','Sorry, that is not a valid OpenID. Ensure you have spelled your ID correctly.','','none'),(4240,'','default','Complete the registration by filling out the form below. If you already have an account, you can <a href=\"@login\">log in</a> now and add your OpenID under \"My account\".','','none'),(4241,'','default','Account registration using the information provided by your OpenID provider failed due to the reasons listed below. Complete the registration by filling out the form below. If you already have an account, you can <a href=\"@login\">log in</a> now and add your OpenID under \"My account\".','','none'),(4242,'','default','The Overlay module makes the administration pages on your site display in a JavaScript overlay of the page you were viewing when you clicked the administrative link, instead of replacing the page in your browser window. Use the close link on the overlay to return to the page you were viewing when you clicked the link. For more information, see the online handbook entry for <a href=\"@overlay\">Overlay module</a>.','','none'),(4243,'','default','Access the administrative overlay','','none'),(4244,'','default','View administrative pages in the overlay.','','none'),(4245,'','default','Displays the Drupal administration interface in an overlay.','','none'),(4246,'','default','@title dialog','','none'),(4247,'','default','Specify the existing path you wish to alias. For example: node/28, forum/1, taxonomy/term/1.','','none'),(4248,'','default','The Path module allows you to specify an alias, or custom URL, for any existing internal system path. Aliases should not be confused with URL redirects, which allow you to forward a changed or inactive URL to a new URL. In addition to making URLs more readable, aliases also help search engines index content more effectively. Multiple aliases may be used for a single internal system path. To automate the aliasing of paths, you can install the contributed module <a href=\"@pathauto\">Pathauto</a>. For more information, see the online handbook entry for the <a href=\"@path\">Path module</a>.','','none'),(4249,'','default','Creating aliases','','none'),(4250,'','default','Users with sufficient <a href=\"@permissions\">permissions</a> can create aliases under the <em>URL path settings</em> section when they create or edit content. Some examples of aliases are: ','','none'),(4251,'','default','<em>member/jane-smith</em> aliased to internal path <em>user/123</em>','','none'),(4252,'','default','<em>about-us/team</em> aliased to internal path <em>node/456</em>','','none'),(4253,'','default','Managing aliases','','none'),(4254,'','default','The Path module provides a way to search and view a <a href=\"@aliases\">list of all aliases</a> that are in use on your website. Aliases can be added, edited and deleted through this list.','','none'),(4255,'','default','An alias defines a different name for an existing URL path - for example, the alias \'about\' for the URL path \'node/1\'. A URL path can have multiple aliases.','','none'),(4256,'','default','Administer URL aliases','','none'),(4257,'','default','Create and edit URL aliases','','none'),(4258,'','default','The alias is already in use.','','none'),(4259,'','default','Optionally specify an alternative URL by which this term can be accessed. Use a relative path and don\'t add a trailing slash or the URL alias won\'t work.','','none'),(4260,'','default','Enabling execution of PHP in text fields','','none'),(4261,'','default','The PHP filter module allows users with the proper permissions to include custom PHP code that will get executed when pages of your site are processed. While this is a powerful and flexible feature if used by a trusted user with PHP experience, it is a significant and dangerous security risk in the hands of a malicious or inexperienced user. Even a trusted user may accidentally compromise the site by entering malformed or incorrect PHP code. Only the most trusted users should be granted permission to use the PHP filter, and all PHP code added through the PHP filter should be carefully examined before use. <a href=\"@php-snippets\">Example PHP snippets</a> can be found on Drupal.org.','','none'),(4262,'','default','Use PHP for settings','','none'),(4263,'','default','<p>Add a custom block to your site, named \"Welcome\" . With its text format set to \"PHP code\" (or another format supporting PHP input), add the following in the Block body:</p>\n<pre>\nprint t(\'Welcome visitor! Thank you for visiting.\');\n</pre>','','none'),(4264,'','default','<p>To display the name of a registered user, use this instead:</p>\n<pre>\nglobal $user;\nif ($user->uid) {\n  print t(\'Welcome @name! Thank you for visiting.\', array(\'@name\' => format_username($user)));\n}\nelse {\n  print t(\'Welcome visitor! Thank you for visiting.\');\n}\n</pre>','','none'),(4265,'','default','The PHP module has been disabled. Any existing content that was using the PHP filter will now be visible in plain text. This might pose a security risk by exposing sensitive information, if any, used in the PHP code.','','none'),(4266,'','default','The Poll module can be used to create simple surveys or questionnaires that display cumulative results. A poll is a good way to receive feedback from site users and community members. For more information, see the online handbook entry for the <a href=\"@poll\">Poll module</a>.','','none'),(4267,'','default','Creating a poll','','none'),(4268,'','default','Users can create a poll by clicking on Poll on the <a href=\"@add-content\">Add new content</a> page, and entering the question being posed, the answer choices, and beginning vote counts for each choice. The status (closed or active) and duration (length of time the poll remains active for new votes) can also be specified.','','none'),(4269,'','default','Viewing polls','','none'),(4270,'','default','You can visit the <a href=\"@poll\">Polls</a> page to view all current polls, or alternately enable the <em>Most recent poll</em> block on the <a href=\"@blocks\">Blocks administration page</a>. To vote in or view the results of a specific poll, you can click on the poll itself.','','none'),(4271,'','default','Vote on polls','','none'),(4272,'','default','Cancel and change own votes','','none'),(4273,'','default','Your vote was cancelled.','','none'),(4274,'','default','To enable browsing this field by value, enter a title for the resulting page. The word <code>%value</code> will be substituted with the corresponding value. An example page title is \"People whose favorite color is %value\" . This is only applicable for a public field.','','none'),(4275,'','default','To enable browsing this field by value, enter a title for the resulting page. An example page title is \"People who are employed\" . This is only applicable for a public field.','','none'),(4276,'','default','The Profile module allows site administrators to define custom fields (such as country, full name, or age) for user profiles, which are then displayed in the <a href=\"@user\">My Account</a> section. This permits users of a site to share more information about themselves, and can help community-based sites organize users around specific information. For more information, see the online handbook entry for <a href=\"@profile\">Profile module</a>.','','none'),(4277,'','default','Adding fields to the default profile','','none'),(4278,'','default','To provide the ability for users to enter more information about themselves, the Profile module allows additional fields to be added to the default user profile. Examples of common additions would be <em>Location</em>, <em>Company</em>, <em>Age</em>, or <em>About me</em>.','','none'),(4279,'','default','User information pages','','none'),(4280,'','default','The Profile module enables links to see further information about site users. You can view both a main <a href=\"@profile\">User list page</a>, and more specified pages by clicking on linked fields in any profile. For example, the <a href=\"@profile-country\">People who live in Canada</a> listing on Drupal.org displays all users who have entered <em>Canada</em> in the <em>Country</em> field on their user profile.','','none'),(4281,'','default','Author information block','','none'),(4282,'','default','The <em>Author information block</em> is a default block created by the Profile module that can be enabled on the <a href=\"@blocks\">Blocks administration page</a>. It shows visitors of your website information about the author of the page they are reading.','','none'),(4283,'','default','This page displays a list of the existing custom profile fields to be displayed on a user\'s <em>My account</em> page. To provide structure, similar or related fields may be placed inside a category. To add a new category (or edit an existing one), edit a profile field and provide a new category name.','','none'),(4284,'','default','Enriches your content with metadata to let other applications (e.g. search engines, aggregators) better understand its relationships and attributes.','','none'),(4285,'','default','The active search modules have been changed.','','none'),(4286,'','default','You must include at least one positive keyword with 1 character or more.','','none'),(4287,'','default','You must include at least one positive keyword with @count characters or more.','','none'),(4288,'','default','You must include at least one positive keyword with @count[2] characters or more.','','none'),(4289,'','default','The Search module provides the ability to index and search for content by exact keywords, and for users by username or e-mail. For more information, see the online handbook entry for <a href=\"@search-module\">Search module</a>.','','none'),(4290,'','default','Searching content and users','','none'),(4291,'','default','Users with <em>Use search</em> permission can use the search block and <a href=\"@search\">Search page</a>. Users with the <em>View published content</em> permission can search for content containing exact keywords. Users with the <em>View user profiles</em> permission can search for users containing the keyword anywhere in the user name, and users with the <em>Administer users</em> permission can search for users by email address. Additionally, users with <em>Use advanced search</em> permission can find content using more complex search methods and filtering by choosing the <em>Advanced search</em> option on the <a href=\"@search\">Search page</a>.','','none'),(4292,'','default','Indexing content with cron','','none'),(4293,'','default','Configuring search settings','','none'),(4294,'','default','Indexing behavior can be adjusted using the <a href=\"@searchsettings\">Search settings page</a>. Users with <em>Administer search</em> permission can control settings such as the <em>Number of items to index per cron run</em>, <em>Indexing settings</em> (word length), <em>Active search modules</em>, and <em>Content ranking</em>, which lets you adjust the priority in which indexed content is returned in results.','','none'),(4295,'','default','The Search module includes a default <em>Search form</em> block, which can be enabled and configured on the <a href=\"@blocks\">Blocks administration page</a>. The block is available to users with the <em>Search content</em> permission.','','none'),(4296,'','default','Extending Search module','','none'),(4297,'','default','By default, the Search module only supports exact keyword matching in content searches. You can modify this behavior by installing a language-specific stemming module for your language (such as <a href=\"http://drupal.org/project/porterstemmer\">Porter Stemmer</a> for American English), which allows words such as walk, walking, and walked to be matched in the Search module. Another approach is to use a third-party search technology with stemming or partial word matching features built in, such as <a href=\"http://drupal.org/project/apachesolr\">Apache Solr</a> or <a href=\"http://drupal.org/project/sphinx\">Sphinx</a>. These and other <a href=\"@contrib-search\">search-related contributed modules</a> can be downloaded by visiting Drupal.org.','','none'),(4298,'','default','<ul>\n<li>Check if your spelling is correct.</li>\n<li>Remove quotes around phrases to search for each word individually. <em>bike shed</em> will often show more results than <em>&quot;bike shed&quot;</em>.</li>\n<li>Consider loosening your query with <em>OR</em>. <em>bike OR shed</em> will often show more results than <em>bike shed</em>.</li>\n</ul>','','none'),(4299,'','default','Administer search','','none'),(4300,'','default','Use search','','none'),(4301,'','default','Use advanced search','','none'),(4302,'','default','Configure relevance settings for search and other indexing options.','','none'),(4303,'','default','Choose a set of shortcuts to use','','none'),(4304,'','default','Choose a set of shortcuts for this user','','none'),(4305,'','default','You are now using the new %set_name shortcut set. You can edit it from this page or <a href=\"@switch-url\">switch back to a different one.</a>','','none'),(4306,'','default','%user is now using a new shortcut set called %set_name. You can edit it from this page.','','none'),(4307,'','default','You are now using the %set_name shortcut set.','','none'),(4308,'','default','%user is now using the %set_name shortcut set.','','none'),(4309,'','default','Change set','','none'),(4310,'','default','The shortcut set has been updated.','','none'),(4311,'','default','Add new shortcut','','none'),(4312,'','default','Editing @shortcut','','none'),(4313,'','default','The name of the shortcut.','','none'),(4314,'','default','The path to the shortcut.','','none'),(4315,'','default','The link must correspond to a valid path on the site.','','none'),(4316,'','default','The shortcut %link has been updated.','','none'),(4317,'','default','Added a shortcut for %title.','','none'),(4318,'','default','Are you sure you want to delete the shortcut %title?','','none'),(4319,'','default','The shortcut %title has been deleted.','','none'),(4320,'','default','Unable to add a shortcut for %title.','','none'),(4321,'','default','Adding and removing shortcuts','','none'),(4322,'','default','Displaying shortcuts','','none'),(4323,'','default','You can display your shortcuts by enabling the Shortcuts block on the <a href=\"@blocks\">Blocks administration page</a>. Certain administrative modules also display your shortcuts; for example, the core <a href=\"@toolbar-help\">Toolbar module</a> displays them near the top of the page, along with an <em>Edit shortcuts</em> link.','','none'),(4324,'','default','Administer shortcuts','','none'),(4325,'','default','@shortcut_set shortcuts','','none'),(4326,'','default','Add to %shortcut_set shortcuts','','none'),(4327,'','default','Add to shortcuts','','none'),(4328,'','default','Remove from %shortcut_set shortcuts','','none'),(4329,'','default','Remove from shortcuts','','none'),(4330,'','default','Edit shortcuts','','none'),(4331,'','default','Add shortcut','','none'),(4332,'','default','Edit shortcut','','none'),(4333,'','default','Delete shortcut','','none'),(4334,'','default','Allows users to manage customizable lists of shortcut links.','','none'),(4335,'','default','Value @value is TRUE.','','none'),(4336,'','default','Value @value is FALSE.','','none'),(4337,'','default','Value @value is NULL.','','none'),(4338,'','default','Value @value is not NULL.','','none'),(4339,'','default','Value @first is equal to value @second.','','none'),(4340,'','default','Value @first is not equal to value @second.','','none'),(4341,'','default','Value @first is identical to value @second.','','none'),(4342,'','default','Value @first is not identical to value @second.','','none'),(4343,'','default','The test did not complete due to a fatal error.','','none'),(4344,'','default','Link with label %label found.','','none'),(4345,'','default','Link with label %label not found.','','none'),(4346,'','default','Link containing href %href found.','','none'),(4347,'','default','No link containing href %href found.','','none'),(4348,'','default','Clicked link %label (@url_target) from @url_before','','none'),(4349,'','default','Option @option for field @id is selected.','','none'),(4350,'','default','Option @option for field @id is not selected.','','none'),(4351,'','default','By default SimpleTest will clear the results after they have been viewed on the results page, but in some cases it may be useful to leave the results in the database. The results can then be viewed at <em>admin/config/development/testing/[test_id]</em>. The test ID can be found in the database, simpletest table, or kept track of when viewing the results the first time. Additionally, some modules may provide more analysis or features that require this setting to be disabled.','','none'),(4352,'','default','GSS negotiate','','none'),(4353,'','default','NTLM','','none'),(4354,'','default','Any safe','','none'),(4355,'','default','The Testing module provides a framework for running automated unit tests. It can be used to verify a working state of Drupal before and after any code changes, or as a means for developers to write and execute tests for their modules. For more information, see the online handbook entry for <a href=\"@simpletest\">Testing module</a>.','','none'),(4356,'','default','Running tests','','none'),(4357,'','default','Visit the <a href=\"@admin-simpletest\">Testing page</a> to display a list of available tests. For comprehensive testing, select <em>all</em> tests, or individually select tests for more targeted testing. Note that it might take several minutes for all tests to complete. For more information on creating and modifying your own tests, see the <a href=\"@simpletest-api\">Testing API Documentation</a> in the Drupal handbook.','','none'),(4358,'','default','After the tests run, a message will be displayed next to each test group indicating whether tests within it passed, failed, or had exceptions. A pass means that the test returned the expected results, while fail means that it did not. An exception normally indicates an error outside of the test, such as a PHP warning or notice. If there were failures or exceptions, the results will be expanded to show details, and the tests that had failures or exceptions will be indicated in red or pink rows. You can then use these results to refine your code and tests, until all tests pass.','','none'),(4359,'','default','Administer tests','','none'),(4360,'','default','The test run finished in @elapsed.','','none'),(4361,'','default','Use the <em>Clean environment</em> button to clean-up temporary files and tables.','','none'),(4362,'','default','The testing framework requires the PHP <a href=\"@open_basedir-url\">open_basedir</a> restriction to be disabled. Check your webserver configuration or contact your web host.','','none'),(4363,'','default','The testing framework could not be installed because the PHP <a href=\"@curl_url\">cURL</a> library is not available.','','none'),(4364,'','default','The testing framework could not be installed because the PHP <a href=\"@hash_url\">hash</a> extension is disabled.','','none'),(4365,'','default','PHP open_basedir restriction','','none'),(4366,'','default','unblock IP address','','none'),(4367,'','default','block IP address','','none'),(4368,'','default','The Statistics module shows you how often a given page is viewed, who viewed it, the previous page the user visited (referrer URL), and when it was viewed. These statistics are useful in determining how users are visiting and navigating your site. For more information, see the online handbook entry for the <a href=\"@statistics\">Statistics module</a>.','','none'),(4369,'','default','Managing logs','','none'),(4370,'','default','To enable collection of statistics, the <em>Enable access log</em> checkbox on the <a href=\"@statistics-settings\">Statistics settings page</a> must be checked. The <em>Discard access logs older than</em> setting on the settings page specifies the length of time entries are kept in the log before they are deleted. This setting requires a correctly configured <a href=\"@cron\">cron maintenance task</a> to run.','','none'),(4371,'','default','Viewing site usage','','none'),(4372,'','default','The Statistics module can help you break down details about your users and how they are using the site. The module offers four reports:','','none'),(4373,'','default','<a href=\"@recent-hits\">Recent hits</a> displays information about the latest activity on your site, including the URL and title of the page that was accessed, the user name (if available) and the IP address of the viewer.','','none'),(4374,'','default','<a href=\"@top-referrers\">Top referrers</a> displays where visitors came from (referrer URL).','','none'),(4375,'','default','<a href=\"@top-pages\">Top pages</a> displays a list of pages ordered by how often they were viewed.','','none'),(4376,'','default','<a href=\"@top-visitors\">Top visitors</a> shows you the most active visitors for your site and allows you to ban abusive visitors.','','none'),(4377,'','default','Displaying popular content','','none'),(4378,'','default','The module includes a <em>Popular content</em> block that displays the most viewed pages today and for all time, and the last content viewed. To use the block, enable <em>Count content views</em> on the <a href=\"@statistics-settings\">statistics settings page</a>, and then you can enable and configure the block on the <a href=\"@blocks\">blocks administration page</a>.','','none'),(4379,'','default','Page view counter','','none'),(4380,'','default','The Statistics module includes a counter for each page that increases whenever the page is viewed. To use the counter, enable <em>Count content views</em> on the <a href=\"@statistics-settings\">statistics settings page</a>, and set the necessary <a href=\"@permissions\">permissions</a> (<em>View content hits</em>) so that the counter is visible to the users.','','none'),(4381,'','default','Administer statistics','','none'),(4382,'','default','View content access statistics','','none'),(4383,'','default','View content hits','','none'),(4384,'','default','Control details about what and how your site logs access statistics.','','none'),(4385,'','default','The Syslog module logs events by sending messages to the logging facility of your web server\'s operating system. Syslog is an operating system administrative logging tool that provides valuable information for use in system management and security auditing. Most suited to medium and large sites, Syslog provides filtering tools that allow messages to be routed by type and severity. For more information, see the online handbook entry for <a href=\'@syslog\'>Syslog module</a> and PHP\'s <a href=\'@php_openlog\'>openlog</a> and <a href=\'@php_syslog\'>syslog</a> functions.','','none'),(4386,'','default','Logging for UNIX, Linux, and Mac OS X','','none'),(4387,'','default','On UNIX, Linux, and Mac OS X, the file <em>/etc/syslog.conf</em> defines the routing configuration. Messages can be flagged with the codes <code>LOG_LOCAL0</code> through <code>LOG_LOCAL7</code>. For information on Syslog facilities, severity levels, and how to set up <em>syslog.conf</em>, see the <em>syslog.conf</em> manual page on your command line.','','none'),(4388,'','default','Logging for Microsoft Windows','','none'),(4389,'','default','On Microsoft Windows, messages are always sent to the Event Log using the code <code>LOG_USER</code>.','','none'),(4390,'','default','Syslog facility','','none'),(4391,'','default','Depending on the system configuration, Syslog and other logging tools use this code to identify or filter messages from within the entire system log.','','none'),(4392,'','default','The image %file could not be rotated because the imagerotate() function is not available in this PHP installation.','','none'),(4393,'','default','The image %file could not be desaturated because the imagefilter() function is not available in this PHP installation.','','none'),(4394,'','default','Screenshot for !theme theme','','none'),(4395,'','default','Settings for !theme theme','','none'),(4396,'','default','Disable !theme theme','','none'),(4397,'','default','Set !theme as default th