come message with further instructions has been sent to your e-mail address.','','none'),(4919,'','default','Configure user accounts.','','7.19'),(4920,'','default','Configure default behavior of users, including registration requirements, e-mails, fields, and user pictures.','','7.19'),(4921,'','default','%module module installed.','','none'),(4922,'','default','Table %name already exists.','','none'),(4923,'','default','Cannot rename %table to %table_new: table %table doesn\'t exist.','','none'),(4924,'','default','Cannot rename %table to %table_new: table %table_new already exists.','','none'),(4925,'','default','Cannot add field %table.%field: table doesn\'t exist.','','none'),(4926,'','default','Cannot add field %table.%field: field already exists.','','none'),(4927,'','default','Cannot set default value of field %table.%field: field doesn\'t exist.','','none'),(4928,'','default','Cannot remove default value of field %table.%field: field doesn\'t exist.','','none'),(4929,'','default','Cannot add primary key to table %table: table doesn\'t exist.','','none'),(4930,'','default','Cannot add primary key to table %table: primary key already exists.','','none'),(4931,'','default','Cannot add unique key %name to table %table: table doesn\'t exist.','','none'),(4932,'','default','Cannot add unique key %name to table %table: unique key already exists.','','none'),(4933,'','default','Cannot add index %name to table %table: table doesn\'t exist.','','none'),(4934,'','default','Cannot add index %name to table %table: index already exists.','','none'),(4935,'','default','Cannot change the definition of field %table.%name: field doesn\'t exist.','','none'),(4936,'','default','Cannot rename field %table.%name to %name_new: target field already exists.','','none'),(4937,'','default','Use this page to create a new custom block.','','none'),(4938,'','default','Number of recent blog posts to display','','none'),(4939,'','default','@node_type comment','','none'),(4940,'','default','Edit comment %comment','','none'),(4941,'','default','The Field UI module provides an administrative user interface (UI) for attaching and managing fields. Fields can be defined at the content-type level for content items and comments, at the vocabulary level for taxonomy terms, and at the site level for user accounts. Other modules may also enable fields to be defined for their data. Field types (text, image, number, etc.) are defined by modules, and collected and managed by the <a href=\"@field\">Field module</a>. For more information, see the online handbook entry for <a href=\"@field_ui\" target=\"_blank\">Field UI module</a>.','','none'),(4942,'','default','Planning fields','','none'),(4943,'','default','What the field will be called','','none'),(4944,'','default','A field has a <em>label</em> (the name displayed in the user interface) and a <em>machine name</em> (the name used internally). The label can be changed after you create the field, if needed, but the machine name cannot be changed after you have created the field.','','none'),(4945,'','default','What type of data the field will store','','none'),(4946,'','default','Each field can store one type of data (text, number, file, etc.). When you define a field, you choose a particular <em>field type</em>, which corresponds to the type of data you want to store. The field type cannot be changed after you have created the field.','','none'),(4947,'','default','How the data will be input and displayed','','none'),(4948,'','default','How many values the field will store','','none'),(4949,'','default','You can store one value, a specific maximum number of values, or an unlimited number of values in each field. For example, an employee identification number field might store a single number, whereas a phone number field might store multiple phone numbers. This setting can be changed after you have created the field, but if you reduce the maximum number of values, you may lose information.','','none'),(4950,'','default','Reusing fields','','none'),(4951,'','default','Once you have defined a field, you can reuse it. For example, if you define a custom image field for one content type, and you need to have an image field with the same parameters on another content type, you can add the same field to the second content type, in the <em>Add existing field</em> area of the user interface. You could also add this field to a taxonomy vocabulary, comments, user accounts, etc.','','none'),(4952,'','default','Some settings of a reused field are unique to each use of the field; others are shared across all places you use the field. For example, the label of a text field is unique to each use, while the setting for the number of values is shared.','','none'),(4953,'','default','There are two main reasons for reusing fields. First, reusing fields can save you time over defining new fields. Second, reusing fields also allows you to display, filter, group, and sort content together by field across content types. For example, the contributed Views module allows you to create lists and tables of content. So if you use the same field on multiple content types, you can create a View containing all of those content types together displaying that field, sorted by that field, and/or filtered by that field.','','none'),(4954,'','default','Fields on content items','','none'),(4955,'','default','Fields on content items are defined at the content-type level, on the <em>Manage fields</em> tab of the content type edit page (which you can reach from the <a href=\"@types\">Content types page</a>). When you define a field for a content type, each content item of that type will have that field added to it. Some fields, such as the Title and Body, are provided for you when you create a content type, or are provided on content types created by your installation profile.','','none'),(4956,'','default','Fields on taxonomy terms','','none'),(4957,'','default','Fields on taxonomy terms are defined at the taxonomy vocabulary level, on the <em>Manage fields</em> tab of the vocabulary edit page (which you can reach from the <a href=\"@taxonomy\">Taxonomy page</a>). When you define a field for a vocabulary, each term in that vocabulary will have that field added to it. For example, you could define an image field for a vocabulary to store an icon with each term.','','none'),(4958,'','default','Fields on user accounts','','none'),(4959,'','default','Fields on user accounts are defined on a site-wide basis on the <a href=\"@fields\">Manage fields tab</a> of the <a href=\"@accounts\">Account settings</a> page. When you define a field for user accounts, each user account will have that field added to it. For example, you could add a long text field to allow users to include a biography.','','none'),(4960,'','default','Fields on comments','','none'),(4961,'','default','Fields on comments are defined at the content-type level, on the <em>Comment fields</em> tab of the content type edit page (which you can reach from the <a href=\"@types\">Content types page</a>). When you add a field for comments, each comment on a content item of that type will have that field added to it. For example, you could add a website field to the comments on forum posts, to allow forum commenters to add a link to their website.','','none'),(4962,'','default','Administer text formats and filters','','none'),(4963,'','default','@type language detection','','none'),(4964,'','default','Strings in the uploaded file replace existing ones, new ones are added. The plural format is updated.','','none'),(4965,'','default','Existing strings and the plural format are kept, only new strings are added.','','none'),(4966,'','default','Define how to decide which language is used to display page elements (primarily text provided by Drupal and modules, such as field labels and help text). This decision is made by evaluating a series of detection methods for languages; the first detection method that gets a result will determine which language is used for that type of text. Define the order of evaluation of language detection methods on this page.','','none'),(4967,'','default','User interface text','','none'),(4968,'','default','Use the detected interface language.','','none'),(4969,'','default','Add new %type','','none'),(4970,'','default','The new set is created by copying items from your default shortcut set.','','none'),(4971,'','default','The new set is created by copying items from the %default set.','','none'),(4972,'','default','You are currently using the %set-name shortcut set.','','none'),(4973,'','default','edit set name','','none'),(4974,'','default','delete set','','none'),(4975,'','default','Create new set','','none'),(4976,'','default','The %set_name shortcut set has been created. You can edit it from this page.','','none'),(4977,'','default','Updated set name to %set-name.','','none'),(4978,'','default','If you have chosen this shortcut set as the default for some or all users, they may also be affected by deleting it.','','none'),(4979,'','default','Are you sure you want to delete the shortcut set %title?','','none'),(4980,'','default','The shortcut set %title has been deleted.','','none'),(4981,'','default','1 user has chosen or been assigned to this shortcut set.','','none'),(4982,'','default','@count users have chosen or been assigned to this shortcut set.','','none'),(4983,'','default','@count[2] users have chosen or been assigned to this shortcut set.','','none'),(4984,'','default','The Shortcut module allows users to create sets of <em>shortcut</em> links to commonly-visited pages of the site. Shortcuts are contained within <em>sets</em>. Each user with <em>Select any shortcut set</em> permission can select a shortcut set created by anyone at the site. For more information, see the online handbook entry for <a href=\"@shortcut\">Shortcut module</a>.','','none'),(4985,'','default','Administering shortcuts','','none'),(4986,'','default','Users with the <em>Administer shortcuts</em> permission can manage shortcut sets and edit the shortcuts within sets from the <a href=\"@shortcuts\">Shortcuts administration page</a>.','','none'),(4987,'','default','Choosing shortcut sets','','none'),(4988,'','default','Users with permission to switch shortcut sets can choose a shortcut set to use from the Shortcuts tab of their user account page.','','none'),(4989,'','default','The Shortcut module creates an add/remove link for each page on your site; the link lets you add or remove the current page from the currently-enabled set of shortcuts (if your theme displays it and you have permission to edit your shortcut set). The core Seven administration theme displays this link next to the page title, as a small + or - sign. If you click on the + sign, you will add that page to your preferred set of shortcuts. If the page is already part of your shortcut set, the link will be a - sign, and will allow you to remove the current page from your shortcut set.','','none'),(4990,'','default','Define which shortcut set you are using on the <a href=\"@shortcut-link\">Shortcuts tab</a> of your account page.','','none'),(4991,'','default','Edit current shortcut set','','none'),(4992,'','default','Editing the current shortcut set will affect other users if that set has been assigned to or selected by other users. Granting \"Select any shortcut set\" permission along with this permission will grant permission to edit any shortcut set.','','none'),(4993,'','default','Select any shortcut set','','none'),(4994,'','default','From all shortcut sets, select one to be own active set. Without this permission, an administrator selects shortcut sets for users.','','none'),(4995,'','default','Add and modify shortcut sets.','','none'),(4996,'','default','Add shortcut set','','none'),(4997,'','default','Edit set name','','none'),(4998,'','default','Delete shortcut set','','none'),(4999,'','default','@remote could not be saved to @path.','','none'),(5000,'','default','