s.','','none'),(5021,'','default','You must validate your email address for this account before logging in via OpenID.','','none'),(5022,'','default','The HTML ID %id is unique.','','none'),(5023,'','default','Syslog format','','none'),(5024,'','default','Specify the format of the syslog entry. Available variables are: <dl><dt><code>!base_url</code></dt><dd>Base URL of the site.</dd><dt><code>!timestamp</code></dt><dd>Unix timestamp of the log entry.</dd><dt><code>!type</code></dt><dd>The category to which this message belongs.</dd><dt><code>!ip</code></dt><dd>IP address of the user triggering the message.</dd><dt><code>!request_uri</code></dt><dd>The requested URI.</dd><dt><code>!referer</code></dt><dd>HTTP Referer if available.</dd><dt><code>!uid</code></dt><dd>User ID.</dd><dt><code>!link</code></dt><dd>A link to associate with the message.</dd><dt><code>!message</code></dt><dd>The message to store in the log.</dd></dl>','','none'),(5025,'','default','External resources can be optimized automatically, which can reduce both the size and number of requests made to your website.','','none'),(5026,'','default','A date in \'time-since\' format. (%date)','','none'),(5027,'','default','The location of the file relative to Drupal root.','','none'),(5028,'','default','HTTP error @errorcode occurred when trying to fetch @remote.','','none'),(5029,'','default','Your system or network configuration does not allow Drupal to access web pages, resulting in reduced functionality. This could be due to your webserver configuration or PHP settings, and should be resolved in order to download information about available updates, fetch aggregator feeds, sign in via OpenID, or use other network-dependent services. If you are certain that Drupal can access web pages but you are still seeing this message, you may add <code>$conf[\'drupal_http_request_fails\'] = FALSE;</code> to the bottom of your settings.php file.','','none'),(5030,'','default','A translation of %title in %language already exists, a new %type will be created instead of a translation.','','none'),(5031,'','default','Your modules have been downloaded and updated.','','none'),(5032,'','default','<a href=\"@update\">Run database updates</a>','','none'),(5033,'','default','@name <em>(locked)</em>','','none'),(5034,'','default','Are you sure you want to delete the role %name ?','','none'),(5035,'','default','Permissions let you control what users can do and see on your site. You can define a specific set of permissions for each role. (See the <a href=\"@role\">Roles</a> page to create a role). Two important roles to consider are Authenticated Users and Administrators. Any permissions granted to the Authenticated Users role will be given to any user who can log into your site. You can make any role the Administrator role for the site, meaning this will be granted all new permissions automatically. You can do this on the <a href=\"@settings\">User Settings</a> page. You should be careful to ensure that only trusted users are given this access and level of control of your site.','','none'),(5036,'','default','Roles allow you to fine tune the security and administration of Drupal. A role defines a group of users that have certain privileges as defined on the <a href=\"@permissions\">permissions page</a>. Examples of roles include: anonymous user, authenticated user, moderator, administrator and so on. In this area you will define the names and order of the roles on your site. It is recommended to order your roles from least permissive (anonymous user) to most permissive (administrator). To delete a role choose \"edit role\".','','none'),(5037,'','default','Use <em>articles</em> for time-sensitive content like news, press releases or blog posts.','','none'),(5038,'','default','Filipino','','none'),(5039,'','default','Swiss German','','none'),(5040,'','default','Scots','','none'),(5041,'; modules/file/file.js','default','The selected file %filename cannot be uploaded. Only files with the following extensions are allowed: %extensions.','','none'),(5042,'','default','Cache pages for anonymous users','','none'),(5043,'','default','Bartik','','7.19'),(5044,'','default','A flexible, recolorable theme with many regions.','','none'),(5045,'','default','Highlighted','','7.19'),(5046,'','default','Sidebar second','','7.19'),(5047,'','default','Triptych first','','none'),(5048,'','default','Triptych middle','','none'),(5049,'','default','Triptych last','','none'),(5050,'','default','Main background','','none'),(5051,'','default','Sidebar background','','none'),(5052,'','default','Sidebar borders','','none'),(5053,'','default','Footer background','','none'),(5054,'','default','Plum','','none'),(5055,'','default','!local-task-title!active','','7.19'),(5056,'','default','A space-separated list of HTML tags allowed in the content of feed items. Disallowed tags are stripped from the content.','','none'),(5057,'','default','%field may only contain characters a-z, underscores, or hyphens.','','none'),(5058,'','default','%field cannot contain any markup.','','none'),(5059,'','default','No URL aliases available. <a href=\"@link\">Add URL alias</a>.','','none'),(5060,'','default','To provide keyword searching, the search engine maintains an index of words found in the content and its fields, along with text added to your content by other modules (such as comments from the core Comment module, and taxonomy terms from the core Taxonomy module). To build and maintain this index, a correctly configured <a href=\"@cron\">cron maintenance task</a> is required. Users with <em>Administer search</em> permission can further configure the cron settings on the <a href=\"@searchsettings\">Search settings page</a>.','','none'),(5061,'','default','Content reindexing','','none'),(5062,'','default','Content-related actions on your site (creating, editing, or deleting content and comments) automatically cause affected content items to be marked for indexing or reindexing at the next cron run. When content is marked for reindexing, the previous content remains in the index until cron runs, at which time it is replaced by the new content. Unlike content-related actions, actions related to the structure of your site do not cause affected content to be marked for reindexing. Examples of structure-related actions that affect content include deleting or editing taxonomy terms, enabling or disabling modules that add text to content (such as Taxonomy, Comment, and field-providing modules), and modifying the fields or display parameters of your content types. If you take one of these actions and you want to ensure that the search index is updated to reflect your changed site structure, you can mark all content for reindexing by clicking the \"Re-index site\" button on the <a href=\"@searchsettings\">Search settings page</a>. If you have a lot of content on your site, it may take several cron runs for the content to be reindexed.','','none'),(5063,'','default','Cached pages will not be re-created until at least this much time has elapsed.','','none'),(5064,'','default','Expiration of cached pages','','none'),(5065,'','default','The maximum time an external cache can use an old version of a page.','','none'),(5066,'','default','These options control the display settings for the %name theme. When your site is displayed using this theme, these settings will be used.','','none'),(5067,'','default','Administer software updates','','none'),(5068,'','default','Enter a valid email address or use a token e-mail address such as %author.','','none'),(5069,'','default','@required_name (Missing)','','none'),(5070,'','default','@required_name (Version @compatibility required)','','none'),(5071,'','default','@name requires at least PHP @version.','','none'),(5072,'','default','Unresolved dependency','','none'),(5073,'','default','@name requires this module.','','none'),(5074,'','default','@name requires this module and version. Currently using @required_name version @version